	      var headers = { 'Accept': 'application/json', 'Authentication': core.config.session };
	      var apiPath = 'plugins/fullcontact/api/index.php/person/' + email;

	      // Email
	      visitor.find('#email').attr('href', 'mailto:' + email).text(email);
